import Head from "next/head";
import Navbar from "../components/Navbar";

const Layout = props => {
	return (
		<div>
			<Head>
				<title>BitzPrice</title>
				<link
					rel="stylesheet"
					src="../plugins/lux-bootstrap/bootstrap.css"
				/>
			</Head>
			<Navbar />
			{props.children}
		</div>
	);
};

export default Layout;
